"use strict";var storage={backpack:1,tank:1,filters:8,oxygen:.5,units:.1,idle:6/7.25,sprint:1.2};function updateFields(e){for(var a=document.getElementsByClassName("output"),t=0;t<a.length;t++){var r=a[t];"total"===r.id?r.innerHTML=truncateValue(e):-1<r.className.indexOf("time")?r.innerHTML=parseValueSeconds(e,storage[r.id]):-1<r.className.indexOf("truncate")?r.innerHTML=parseValueTruncate(e,storage[r.id]):r.innerHTML=parseValue(e,storage[r.id])}}function calc(){var e=0;for(var a in storage)if(storage.hasOwnProperty(a)){var t=document.getElementById(a);"any"===t.step?e+=storage[a]*(parseFloat(t.value)||0):e+=storage[a]*(parseInt(t.value)||0)}updateFields(e)}